        <div className="underline"></div>
      </div>
      <div className="inputs">
        <div className="input">
          <img src={account} alt="" />
          <input type="text" />
        </div>
        <div className="input">
          <img src={email} alt="" />
          <input type="email" />
        </div>
        <div className="input">
          <img src={padlock} alt="" />
          <input type="password" />
        </div>
      </div>
    </div>
  );
};

export default LoginSignup;
